enum Category { movie, cartoon, series }

type Card = {
  title: string,
  year: number,
  type: Category,
  image: string,
}


function App() {
  let [ cards, setCards ] = useState();

  return (
    <div className='App'>
      <Menu items={Object.keys(Category).filter(item => isNaN(Number(item)))}/>
      <Footer/>
    </div>
  );
}

export default App;
